--changeset josh:20210213-base-table
CREATE TABLE professor
(
    id   SERIAL NOT NULL
        CONSTRAINT professor_pkey PRIMARY KEY,
    name TEXT
);

CREATE TABLE course
(
    id           SERIAL NOT NULL
        CONSTRAINT course_pkey PRIMARY KEY,
    name         TEXT,
    professor_id BIGINT
        CONSTRAINT course_fk_professor_id REFERENCES professor
);

CREATE INDEX course_idx_professor_id ON course USING btree (professor_id);

CREATE TABLE student
(
    id    SERIAL NOT NULL
        CONSTRAINT student_pkey PRIMARY KEY,
    grade INTEGER,
    name  TEXT
);

CREATE TABLE course_report
(
    id           SERIAL NOT NULL
        CONSTRAINT course_report_pkey PRIMARY KEY,
    course_grade INTEGER,
    course_id    BIGINT
        CONSTRAINT course_report_fk_course_id REFERENCES course,
    student_id   BIGINT
        CONSTRAINT course_report_fk_student_id REFERENCES student
);

CREATE INDEX course_report_idx_course_id ON course_report USING btree (course_id);
CREATE INDEX course_report_idx_student_id ON course_report USING btree (student_id);



